import React from 'react'
import { ToDo } from './ToDo'

export const TableToDo = (props) => {
    const { tasks } = props
    return(
        <div>
            <h1>TableToDo</h1>
            {(tasks.length > 0 )? (
                tasks.map((el, index) => {
                    return <ToDo el = {el} key = {index} />
                }
            )):('')}
        </div>
    )
}
